class MPTBackendAdapter extends EmsHEAP16BackendAdapter {

    constructor() {
        super(backend_module, 2)
        this._manualSetupComplete = true;
        this._undefined;
        this._currentPath;
        this._currentFile;
        this.songInfo = {};

        this._scopeEnabled = false;
    };
    // sample buffer contains 2-byte integer sample data (i.e.
    // must be rescaled) of 2 interleaved channels

    enableScope(enable) {
        this._scopeEnabled = enable;
    }

    doOnAdapterReady() {
        // called when runtime is ready (e.g. asynchronously when WASM is loaded)
        // if FS needed to be setup of would be done here..
    }

    getAudioBuffer() {
        var ptr = this.Module.ccall('emu_get_audio_buffer', 'number');
        // make it a this.Module.HEAP16 pointer
        return ptr >> 1;	// 2 x 16 bit samples
    }

    getAudioBufferLength() {
        var len = this.Module.ccall('emu_get_audio_buffer_length', 'number');
        return len;
    }

    computeAudioSamples() {
        return this.Module.ccall('emu_compute_audio_samples', 'number');
    }

    getMaxPlaybackPosition() {
        return this.Module.ccall('emu_get_max_position', 'number');
    }

    getPlaybackPosition() {
        return this.Module.ccall('emu_get_current_position', 'number');
    }

    seekPlaybackPosition(pos) {
        var current = this.getPlaybackPosition();
        if (pos < current) {
            // hack: for some reason backward seeking fails ('he: execution error') if "built-in"
            // file reload if used...
            var ret = this.Module.ccall('emu_init', 'number', ['string', 'string'], [this._currentPath, this._currentFile]);
        }
        var v = ScriptNodePlayer.getInstance().getVolume();
        ScriptNodePlayer.getInstance().setVolume(0);	// suppress any output while reset is in progress
        this.Module.ccall('emu_seek_position', 'number', ['number'], [pos]);
        ScriptNodePlayer.getInstance().setVolume(v);
    }

    /*
    * Creates the URL used to retrieve the song file.
    */
    mapUrl(filename) {
        // used transform the "internal filename" to a valid URL
        var uri = this.mapFs2Uri(filename);
        return uri;
    }

    mapInternalFilename(overridePath, basePath, filename) {
        //map URLSs to FS
        filename = this.mapUri2Fs(filename);	// treat all songs as "from outside"

        var f = ((overridePath) ? overridePath : basePath) + filename;	// this._basePath ever needed?
        return f;
    }

    getPathAndFilename(filename) {
        var sp = filename.split('/');
        var fn = sp[sp.length - 1];
        var path = filename.substring(0, filename.lastIndexOf("/"));
        if (path.lenght) path = path + "/";

        return [path, fn];
    }

    mapBackendFilename(name) {
        // "name" comes from the C++ side
        var input = this.Module.UTF8ToString(name);
        return input;
    }

    registerFileData(pathFilenameArray, data) {
        // input: the path is fixed to the basePath & the filename is actually still a path+filename
        var path = pathFilenameArray[0];
        var filename = pathFilenameArray[1];

        // MANDATORTY to move any path info still present in the "filename" to "path"
        var tmpPathFilenameArray = new Array(2);	// do not touch original IO param
        var p = filename.lastIndexOf("/");
        if (p > 0) {
            tmpPathFilenameArray[0] = path + filename.substring(0, p);
            tmpPathFilenameArray[1] = filename.substring(p + 1);
        } else {
            tmpPathFilenameArray[0] = path;
            tmpPathFilenameArray[1] = filename;
        }
        // setup data in our virtual FS (the next access should then be OK)
        return this.registerEmscriptenFileData(tmpPathFilenameArray, data);
    }

    loadMusicData(sampleRate, path, filename, data, options) {
        var buf = this.Module._malloc(data.length);
        this.Module.HEAPU8.set(data, buf);

        var ret = this.Module.ccall('emu_init', 'number', ['string', 'string', 'number', 'number'], [path, filename, buf, data.length]);
        this.Module._free(buf);

        if (ret == 0) {
            var inputSampleRate = this.Module.ccall('emu_get_sample_rate', 'number');
            this.resetSampleRate(sampleRate, inputSampleRate);
            this._currentPath = path;
            this._currentFile = filename;
        } else {
            this._currentPath = this._undefined;
            this._currentFile = this._undefined;
        }
        return ret;
    }

    evalTrackOptions() {
        // is there any scenario with subsongs?
        return
    }

    teardown() {
        this.Module.ccall('emu_teardown', 'number');	// just in case
    }


    updateSongInfo(filename) {
        var numAttr = 6;
        var ret = this.Module.ccall('emu_get_track_info', 'number');

        var array = this.Module.HEAP32.subarray(ret >> 2, (ret >> 2) + numAttr);
        this.songInfo.title = this.Module.UTF8ToString(array[0]);
        if (!this.songInfo.title.length) this.songInfo.title = filename.replace(/^.*[\\\/]/, '');
        this.songInfo.artist = this.Module.UTF8ToString(array[1]);
        this.songInfo.type = this.Module.UTF8ToString(array[2]);
        this.songInfo.msg = this.Module.UTF8ToString(array[3]);
        this.songInfo.tracker = this.Module.UTF8ToString(array[4]);
        this.songInfo.tracks = this.Module.UTF8ToString(array[5]);
    }

    readFloatTrace(buffer, idx) {
        // input range is actually 16bit but with 9 or even 18 channels (which are added to create the final signal)
        // only a subrange is typically used (to avoid overflows) and the used scaling seems about OK to create
        // graphs..
        return this.Module.HEAP32[buffer + idx] / 0x8000;
    }

}

const backendAdapter = new MPTBackendAdapter()


class OpenMTPBackendAdapter extends AudioWorkletProcessor {
    constructor() {
        super();
        this.backendAdapter = backendAdapter
        this.backendAdapter.worklet = this

        // this.traceSwitch = false;

        this.spectrumEnabled = false

        // // container for song infos like: name, author, etc
        this.songInfo = {};

        this.silenceStarttime = -1;
        this.silenceTimeout = 5; // by default 5 secs of silence will end a song

        // // audio buffer handling
        this.sourceBuffer;
        this.sourceBufferLen;
        this.numberOfSamplesRendered = 0;
        this.numberOfSamplesToRender = 0;
        this.sourceBufferIdx = 0;

        // // additional timeout based "song end" handling
        this.currentPlaytime = 0;
        this.currentTimeout = -1;

        this.pan = null;  // default: inactive

        // // --------------- player status stuff ----------

        this.isPaused = true;          // 'end' of a song also triggers this state

        // // setup asyc completion of initialization
        this.isPlayerReady = false;    // this state means that the player is initialized and can be used now
        this.isSongReady = false;    // initialized (including file-loads that might have been necessary)
        this.initInProgress = false;


        this.port.onmessage = this.onmessage.bind(this);

    }

    onmessage(e) {
        const { data } = e;
        console.log('onmessage ' + data.type)
        switch (data.type) {

            case 'loadMusicData':
                this.isSongReady = (this.backendAdapter.loadMusicData(data.sampleRate, data.path, data.filename, data.data, data.options) == 0)
                break;

            case 'evalTrackOptions':
                this.backendAdapter.evalTrackOptions(data.options);
                break;

            case 'updateSongInfo':
                const songInfo = this.backendAdapter.updateSongInfo(data.filename);
                this.port.postMessage({
                    type: 'songInfoUpdated',
                    songInfo: songInfo
                });
                break;

            case 'resetSampleRate':
                this.backendAdapter.resetSampleRate(data.sampleRate, -1);
                break;

            case 'play':
                this.isPaused = false;
                break;

            case 'pause':
                this.isPaused = true;
                break;

            case 'registerFileData':
                this.backendAdapter.registerFileData(data.name, data.payload)
                break;

            case 'setTrack':
                this.backendAdapter.evalTrackOptions({track: data.track})
                break;

        }
    }

    isStereo() {
        return this.backendAdapter.getChannels() == 2;
    }

    copySamplesMono(resampleBuffer, output1, outSize) {
        let s = 0,
            o = 0;

        if (this.numberOfSamplesRendered + this.numberOfSamplesToRender > outSize) {
            const availableSpace = outSize - this.numberOfSamplesRendered;

            for (let i = 0; i < availableSpace; i++) {
                const ii = i + this.numberOfSamplesRendered;

                o = resampleBuffer[this.sourceBufferIdx++];
                output1[ii] = o;

                s += Math.abs(o);
            }
            this.numberOfSamplesToRender -= availableSpace;
            this.numberOfSamplesRendered = outSize;
        } else {

            for (let i = 0; i < this.numberOfSamplesToRender; i++) {
                const ii = i + this.numberOfSamplesRendered;

                o = resampleBuffer[this.sourceBufferIdx++];
                output1[ii] = o;

                s += Math.abs(o);
            }
            this.numberOfSamplesRendered += this.numberOfSamplesToRender;
            this.numberOfSamplesToRender = 0;
        }
        this.detectSilence(s);
    }

    copySamplesStereo(resampleBuffer, output1, output2, outSize) {
        let s = 0;

        if (this.numberOfSamplesRendered + this.numberOfSamplesToRender > outSize) {
            const availableSpace = outSize - this.numberOfSamplesRendered;

            for (let i = 0; i < availableSpace; i++) {
                const ii = i + this.numberOfSamplesRendered;

                const l = resampleBuffer[this.sourceBufferIdx++];
                const r = resampleBuffer[this.sourceBufferIdx++];

                output1[ii] = l;
                output2[ii] = r;

                s += Math.abs(l) + Math.abs(r);
            }

            this.numberOfSamplesToRender -= availableSpace;
            this.numberOfSamplesRendered = outSize;
        } else {
            for (let i = 0; i < this.numberOfSamplesToRender; i++) {
                const ii = i + this.numberOfSamplesRendered;

                const l = resampleBuffer[this.sourceBufferIdx++];
                const r = resampleBuffer[this.sourceBufferIdx++];

                output1[ii] = l;
                output2[ii] = r;

                s += Math.abs(l) + Math.abs(r);
            }
            this.numberOfSamplesRendered += this.numberOfSamplesToRender;
            this.numberOfSamplesToRender = 0;
        }
        this.detectSilence(s);
    }

    detectSilence(s) {
        if (this.silenceStarttime == 0) {	// i.e. song has been playing
            if (s == 0) {	// silence detected
                this.silenceStarttime = this.currentPlaytime;
            }
        } else if (s > 0) {	// i.e. false alarm or very start of playback
            this.silenceStarttime = 0;
        }
    }

    fillEmpty(outSize, output1, output2) {
        const availableSpace = outSize - this.numberOfSamplesRendered;

        for (let i = 0; i < availableSpace; i++) {
            output1[i + this.numberOfSamplesRendered] = 0;
            if (typeof output2 !== 'undefined') { output2[i + this.numberOfSamplesRendered] = 0; }
        }
        this.numberOfSamplesToRender = 0;
        this.numberOfSamplesRendered = outSize;
    }

    process(inputs, outputs) {

        const genStereo = this.isStereo() && outputs[0].length > 1;

        const output1 = outputs[0][0];
        const output2 = outputs[0][1];

        if ((!this.isSongReady) || this.isPaused) {
            for (let i = 0; i < output1.length; i++) {
                output1[i] = 0;
                if (genStereo) { output2[i] = 0; }
            }
        } else {

            const outSize = output1.length;

            this.numberOfSamplesRendered = 0;

            while (this.numberOfSamplesRendered < outSize) {
                if (this.numberOfSamplesToRender === 0) {
                    let status;
                    if ((this.currentTimeout > 0) && (this.currentPlaytime > this.currentTimeout)) {
                        console.log("'song end' forced after " + this.currentTimeout / this.correctSampleRate + " secs");
                        status = 1;
                    } else {
                        status = this.backendAdapter.computeAudioSamples()
                    }

                    if (status !== 0) {
                        // no frame left
                        this.fillEmpty(outSize, output1, output2);

                        if (status < 0) {
                            console.log('stuck by file-load')
                            // file-load: emu just discovered that we need to load another file
                            // this.isPaused = true;
                            this.isSongReady = false;     // previous init is invalid
                            return true; // complete init sequence must be repeated
                        } else {
                            if (status > 1) {
                                this.trace("playback aborted with an error");
                            }

                            this.isPaused = true;  // stop playback (or this will retrigger again and again before new song is started)
                            this.port.postMessage({
                                type: 'onTrackEnd'
                            });
                            return;
                        }
                    }
                    // refresh just in case they are not using one fixed buffer..
                    this.sourceBuffer = this.backendAdapter.getAudioBuffer();
                    this.sourceBufferLen = this.backendAdapter.getAudioBufferLength();

                    if (this.pan != null)
                        this.backendAdapter.applyPanning(this.sourceBuffer, this.sourceBufferLen, this.pan + 1.0);

                    this.numberOfSamplesToRender = this.backendAdapter.getResampledAudio(this.sourceBuffer, this.sourceBufferLen);

                    this.sourceBufferIdx = 0;
                }

                const resampleBuffer = this.backendAdapter.getResampleBuffer();

                if (genStereo) {
                    this.copySamplesStereo(resampleBuffer, output1, output2, outSize);
                } else {
                    this.copySamplesMono(resampleBuffer, output1, outSize);
                }
                // console.log('---')
                // console.log(output1)
                // console.log(output2)
            }
            // keep track how long we are playing: just filled one WebAudio buffer which will be played at
            this.currentPlaytime += outSize * this.correctSampleRate / this.sampleRate;

            // silence detection at end of song
            if ((this.silenceStarttime > 0) && ((this.currentPlaytime - this.silenceStarttime) >= this.silenceTimeout * this.correctSampleRate) && (this.silenceTimeout > 0)) {
                this.isPaused = true;  // stop playback (or this will retrigger again and again before new song is started)
                this.port.postMessage({
                    type: 'onTrackEnd'
                });
            }
        }
        return true
    }
}

registerProcessor('openmpt-worklet-processor', OpenMTPBackendAdapter);
